import Search from "assets/images/search-doctor.svg"
import Profile from "assets/images/doctor-profile.svg"
import Appointment from "assets/images/appointment.svg"
import Solution from "assets/images/solution.svg"
const data = [
    {
        id: 1,
        title: "Search Doctor",
        imageUrl: Search,
        description: "We’re here to help whenever you feel ill, but keeping you healthy is out better priority"
    },
    {
        id: 2,
        title: "Check doctor profile",
        imageUrl: Profile,
        description: "We can help you find availiable vaccine appointments near you or notify you when availiable"
    },
    {
        id: 3,
        title: "Schedule Appointment",
        imageUrl: Appointment,
        description: "From seasonal allergies to burn identification and treatments, we have the resources"
    },
    {
        id: 4,
        title: "Get your soltuion",
        imageUrl: Solution,
        description: "We can help you find availiable vaccine appointments near you or notify you when availiable"
    },
]

export default data;
